import React, { useState } from 'react'
import {
  Form,
  Button,
  Spinner,
  Container,
  ProgressBar,
  Navbar,
  Nav,
} from 'react-bootstrap'
import { useNavigate } from 'react-router-dom'
import './ImportFile.css'

const ImportFile = () => {
  const [selectedFile, setSelectedFile] = useState(null)
  const [loading, setLoading] = useState(false)
  const [progress, setProgress] = useState(0) // State for progress
  const navigate = useNavigate()

  const handleFileChange = (e) => {
    setSelectedFile(e.target.files[0])
  }

  const handleFileImport = async () => {
    if (selectedFile) {
      setLoading(true)
      // Simulate importing the PDF file
      let progressInterval = setInterval(() => {
        setProgress((prevProgress) => {
          if (prevProgress < 100) {
            return prevProgress + 10
          } else {
            clearInterval(progressInterval)
            setLoading(false)
            navigate('/service-types')
            return 100
          }
        })
      }, 150) // Simulating progress update every 500ms
    }
  }

  return (
    <div>
      <Navbar bg='light' expand='lg'>
        <Container>
          <Navbar.Brand href=''>Smart ML</Navbar.Brand>
          <Navbar.Toggle aria-controls='basic-navbar-nav' />
          <Navbar.Collapse id='basic-navbar-nav'>
            <Nav className='me-auto'></Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Container className='reference-container'>
        <h2>Reference E-consult Data</h2>
        <Button className='bone-fracture' variant='primary' size='lg'>
          Bone Fracture
        </Button>
        <Button className='oral-surgery' variant='secondary' size='lg'>
          Oral Surgery
        </Button>
      </Container>
      <Container className='import-container'>
        {loading ? (
          <div className='text-center'>
            <Spinner animation='border' role='status'>
              <span className='visually-hidden'>Loading...</span>
            </Spinner>
            Loading...
            <ProgressBar
              now={progress}
              label={`${progress}%`}
              style={{
                height: '30px',
                fontSize: '16px',
              }}
              variant='warning'
            />
          </div>
        ) : (
          <>
            <Form.Group controlId='formFileLg' className='mb-3'>
              <Form.Label className='import-title'>
                Import E-consult Data
              </Form.Label>
              <Form.Control
                type='file'
                size='lg'
                onChange={handleFileChange}
                accept='.pdf,.docx,.txt'
              />
            </Form.Group>
            <Button
              className='import-button'
              variant='primary'
              type='submit'
              onClick={handleFileImport}
              disabled={!selectedFile || loading}
            >
              Upload
            </Button>
          </>
        )}
        {!loading && (
          <Button
            className='import-button'
            variant='primary'
            type='submit'
            onClick={handleFileImport}
            disabled={!selectedFile || loading}
          >
            Upload
          </Button>
        )}
      </Container>
    </div>
  )
}

export default ImportFile
